  1import SwiftUI
  2import StoreKit
  3
  4struct VaultairePaywallView: View {
  5    let onDismiss: () -> Void
  6    var showDismissButton: Bool = true
  7
  8    @Environment(SubscriptionManager.self) private var subscriptionManager
  9
 10    @State private var selectedPlan: PlanType = .annual
 11    @State private var trialEnabled = true
 12    @State private var isPurchasing = false
 13    @State private var errorMessage: String?
 14
 15    // Read products directly from SubscriptionManager (@Observable).
 16    // No .task needed  view updates reactively when products load from init.
 17    private var monthlyProduct: Product? { subscriptionManager.product(for: "monthly_pro") }
 18    private var annualProduct: Product? { subscriptionManager.product(for: "yearly_pro") }
 19    private var lifetimeProduct: Product? { subscriptionManager.product(for: "lifetime") }
 20
 21    private var isTrialEligible: Bool {
 22        guard let annual = annualProduct,
 23              let sub = annual.subscription,
 24              let intro = sub.introductoryOffer,
 25              intro.paymentMode == .freeTrial else { return false }
 26        return true
 27    }
 28
 29    enum PlanType: String, CaseIterable {
 30        case monthly, annual, lifetime
 31    }
 32
 33    var body: some View {
 34        NavigationStack {
 35            ScrollView {
 36                VStack(spacing: 20) {
 37                    headerSection
 38                    benefitsTable
 39                    planSelector
 40                    trialToggle
 41                    ctaButton
 42                    footerSection
 43                }
 44                .padding(.horizontal, 20)
 45                .padding(.top, 16)
 46                .padding(.bottom, 32)
 47            }
 48            .background(Color.vaultBackground.ignoresSafeArea())
 49            .toolbar {
 50                if showDismissButton {
 51                    ToolbarItem(placement: .cancellationAction) {
 52                        Button {
 53                            onDismiss()
 54                        } label: {
 55                            Image(systemName: "xmark")
 56                                .font(.body.weight(.semibold))
 57                                .foregroundStyle(.vaultSecondaryText)
 58                        }
 59                        .accessibilityIdentifier("paywall_dismiss")
 60                    }
 61                }
 62            }
 63        }
 64    }
 65
 66    // MARK: - Header
 67
 68    private var headerSection: some View {
 69        VStack(spacing: 8) {
 70            Text("Unlock Vaultaire Pro")
 71                .font(.title.bold())
 72                .foregroundStyle(.vaultText)
 73
 74            Text("Full privacy, your terms.")
 75                .font(.subheadline)
 76                .foregroundStyle(.vaultSecondaryText)
 77        }
 78    }
 79
 80    // MARK: - Benefits Table
 81
 82    private var benefitsTable: some View {
 83        VStack(spacing: 0) {
 84            HStack {
 85                Text("Feature")
 86                    .font(.caption.weight(.semibold))
 87                    .foregroundStyle(.vaultSecondaryText)
 88                Spacer()
 89                Text("FREE")
 90                    .font(.caption.weight(.semibold))
 91                    .foregroundStyle(.vaultSecondaryText)
 92                    .frame(width: 56)
 93                Text("PRO")
 94                    .font(.caption.weight(.semibold))
 95                    .foregroundStyle(Color.accentColor)
 96                    .frame(width: 56)
 97            }
 98            .padding(.horizontal, 16)
 99            .padding(.vertical, 10)
100
101            Divider().opacity(0.3)
102
103            ForEach(benefits, id: \.label) { benefit in
104                HStack {
105                    Text(benefit.label)
106                        .font(.subheadline)
107                        .foregroundStyle(.vaultText)
108                    Spacer()
109                    benefitCell(benefit.free)
110                        .frame(width: 56)
111                    benefitCell(benefit.pro)
112                        .frame(width: 56)
113                }
114                .padding(.horizontal, 16)
115                .padding(.vertical, 8)
116            }
117        }
118        .vaultGlassBackground()
119    }
120
121    @ViewBuilder
122    private func benefitCell(_ value: String) -> some View {
123        switch value {
124        case "\u{2713}":
125            Image(systemName: "checkmark")
126                .font(.caption.weight(.bold))
127                .foregroundStyle(Color.accentColor)
128        case "\u{2014}":
129            Text("\u{2014}")
130                .font(.subheadline)
131                .foregroundStyle(.vaultSecondaryText)
132        default:
133            Text(value)
134                .font(.caption2.weight(.medium))
135                .foregroundStyle(.vaultText)
136        }
137    }
138
139    // MARK: - Plan Selector
140
141    private var planSelector: some View {
142        VStack(spacing: 10) {
143            planCard(
144                type: .monthly,
145                title: "Monthly",
146                price: monthlyProduct?.displayPrice ?? "$1.99",
147                period: "/month",
148                badge: nil,
149                detail: nil
150            )
151
152            planCard(
153                type: .annual,
154                title: "Annual",
155                price: annualProduct?.displayPrice ?? "$9.99",
156                period: "/year",
157                badge: "SAVE 58%",
158                detail: "$0.83/mo"
159            )
160
161            planCard(
162                type: .lifetime,
163                title: "Lifetime",
164                price: lifetimeProduct?.displayPrice ?? "$29.99",
165                period: " once",
166                badge: "BEST VALUE",
167                detail: "Forever"
168            )
169        }
170    }
171
172    private func planCard(
173        type: PlanType,
174        title: String,
175        price: String,
176        period: String,
177        badge: String?,
178        detail: String?
179    ) -> some View {
180        let isSelected = selectedPlan == type
181
182        // Use onTapGesture instead of Button to avoid gesture conflict with
183        // ScrollView  Button's internal LongPressTap sequence loses taps to
184        // the scroll recognizer when the user's finger moves even slightly.
185        return HStack {
186            VStack(alignment: .leading, spacing: 4) {
187                Text(title)
188                    .font(.headline)
189                    .foregroundStyle(.vaultText)
190
191                if let detail {
192                    Text(detail)
193                        .font(.caption)
194                        .foregroundStyle(.vaultSecondaryText)
195                }
196            }
197
198            Spacer()
199
200            VStack(alignment: .trailing, spacing: 4) {
201                if let badge {
202                    Text(badge)
203                        .font(.caption2.weight(.bold))
204                        .foregroundStyle(.white)
205                        .padding(.horizontal, 8)
206                        .padding(.vertical, 3)
207                        .background(Color.accentColor, in: Capsule())
208                }
209
210                Text("\(price)\(period)")
211                    .font(.subheadline.weight(.semibold))
212                    .foregroundStyle(.vaultText)
213            }
214        }
215        .padding(16)
216        .vaultGlassBackground()
217        .overlay(
218            RoundedRectangle(cornerRadius: 12)
219                .stroke(isSelected ? Color.accentColor : Color.clear, lineWidth: 2)
220        )
221        .contentShape(Rectangle())
222        .onTapGesture {
223            withAnimation(.easeInOut(duration: 0.2)) {
224                selectedPlan = type
225                trialEnabled = type == .annual
226            }
227        }
228        .accessibilityAddTraits(.isButton)
229    }
230
231    // MARK: - Trial Toggle
232
233    @ViewBuilder
234    private var trialToggle: some View {
235        if selectedPlan == .annual && isTrialEligible {
236            HStack(spacing: 8) {
237                Image(systemName: trialEnabled ? "checkmark.circle.fill" : "circle")
238                    .foregroundStyle(trialEnabled ? Color.accentColor : .vaultSecondaryText)
239                    .font(.body)
240                Text("Enable free 7-day trial")
241                    .font(.subheadline.weight(.medium))
242                    .foregroundStyle(.vaultText)
243                Spacer()
244            }
245            .padding(.horizontal, 4)
246            .contentShape(Rectangle())
247            .onTapGesture {
248                withAnimation(.easeInOut(duration: 0.2)) {
249                    trialEnabled.toggle()
250                }
251            }
252            .accessibilityAddTraits(.isButton)
253            .transition(.opacity)
254        }
255    }
256
257    // MARK: - CTA Button
258
259    private var ctaButton: some View {
260        VStack(spacing: 12) {
261            if let errorMessage {
262                Text(errorMessage)
263                    .font(.caption)
264                    .foregroundStyle(.red)
265                    .multilineTextAlignment(.center)
266            }
267
268            Button {
269                Task { await purchase() }
270            } label: {
271                Group {
272                    if isPurchasing {
273                        ProgressView()
274                            .tint(.white)
275                    } else {
276                        Text(ctaText)
277                            .font(.headline)
278                    }
279                }
280                .frame(maxWidth: .infinity)
281                .padding()
282            }
283            .vaultProminentButtonStyle()
284            .disabled(isPurchasing || selectedProduct == nil)
285        }
286    }
287
288    private var ctaText: String {
289        if selectedPlan == .annual && trialEnabled && isTrialEligible {
290            return "Try for 7 days"
291        }
292        switch selectedPlan {
293        case .monthly:
294            return "Subscribe"
295        case .annual:
296            return "Subscribe"
297        case .lifetime:
298            let price = lifetimeProduct?.displayPrice ?? "$29.99"
299            return "Purchase for \(price)"
300        }
301    }
302
303    // MARK: - Footer
304
305    private var footerSection: some View {
306        VStack(spacing: 8) {
307            Text("No commitment \u{00B7} Cancel anytime")
308                .font(.caption)
309                .foregroundStyle(.vaultSecondaryText)
310
311            HStack(spacing: 16) {
312                Button("Restore Purchases") {
313                    Task { await restore() }
314                }
315                Text("\u{00B7}").foregroundStyle(.vaultSecondaryText)
316                Link("Terms", destination: URL(string: "https://vaultaire.app/terms")!)
317                Text("\u{00B7}").foregroundStyle(.vaultSecondaryText)
318                Link("Privacy", destination: URL(string: "https://vaultaire.app/privacy")!)
319            }
320            .font(.caption)
321            .foregroundStyle(.vaultSecondaryText)
322        }
323    }
324
325    // MARK: - Data
326
327    private var selectedProduct: Product? {
328        switch selectedPlan {
329        case .monthly: return monthlyProduct
330        case .annual: return annualProduct
331        case .lifetime: return lifetimeProduct
332        }
333    }
334
335    private struct BenefitRow {
336        let label: String
337        let free: String
338        let pro: String
339    }
340
341    private var benefits: [BenefitRow] {
342        [
343            BenefitRow(label: "Photos per vault", free: "100", pro: "\u{221E}"),
344            BenefitRow(label: "Videos per vault", free: "10", pro: "\u{221E}"),
345            BenefitRow(label: "Vaults", free: "5", pro: "\u{221E}"),
346            BenefitRow(label: "Duress vault", free: "\u{2014}", pro: "\u{2713}"),
347            BenefitRow(label: "Vault sharing", free: "\u{2014}", pro: "\u{2713}"),
348            BenefitRow(label: "iCloud backup", free: "\u{2014}", pro: "\u{2713}"),
349            BenefitRow(label: "Pattern encryption", free: "\u{2713}", pro: "\u{2713}"),
350            BenefitRow(label: "Plausible deniability", free: "\u{2713}", pro: "\u{2713}"),
351        ]
352    }
353
354    // MARK: - Actions
355
356    private func purchase() async {
357        guard let product = selectedProduct else { return }
358        isPurchasing = true
359        errorMessage = nil
360
361        do {
362            let success = try await subscriptionManager.purchase(product)
363            if success {
364                onDismiss()
365            }
366        } catch {
367            errorMessage = error.localizedDescription
368        }
369
370        isPurchasing = false
371    }
372
373    private func restore() async {
374        isPurchasing = true
375        errorMessage = nil
376
